import ReactDom from 'react-dom';

const Person = () => <h2>pratyay gaurav</h2>;
const Message = () => {
  return <p>this is my message</p>;
};


function BookList(){
  return (
    <section>
   <Book/> 
   <Book/> 
   <Book/> 
   <Book/> 
   <Book/> 
   <Book/> 
   <Book/> 
   <Book/> 
    </section>
  )
}

const Book = ()=>{
  return <article>
    this is a book
  </article>
}


ReactDom.render(<BookList/>,document.getElementById('root'))
